import React, { Component } from "react";

import { Card } from "react-bootstrap";

class Olympics extends Component {
  render() {
    return (
      <>
        <Card
          style={{ width: "12rem", border: `none`, margin: `0` }}
          className="card"
        >
          <Card.Img variant="top" src={props.brand.imgUrl} />
          <Card.Body>
            <Card.Title> {props.brand.name}</Card.Title>
            <Card.Text>
              <p>{props.brand.price}</p>
            </Card.Text>
          </Card.Body>
        </Card>
      </>
    );
  }
}

export default Olympics;
